import { BrowserRouter , Routes, Route} from "react-router-dom";
import Messenger from "./pages/Messenger";
function App() {
  return (
    <BrowserRouter>
    <Routes>
    <Route index element={<Messenger/>} />
    </Routes>
  </BrowserRouter>
  );
}

export default App;
